import styled from 'styled-components';
import Checkbox from 'pages/Todo/components/TodoList/Checkbox';
import useGetTodosQuery from 'pages/Todo/queries/useGetTodosQuery';
import Modal from 'pages/components/Modal';

export default function TodoList() {
  const { data } = useGetTodosQuery();

  return (
    <TodoListWrap>
      <AddTodoBtn>할 일 추가하기</AddTodoBtn>
      <Checkbox text="hello" />
      <Modal isOpen>
        <NewTodoModalContainer>
          <NewTodoInput />
        </NewTodoModalContainer>
      </Modal>
    </TodoListWrap>
  );
}

const TodoListWrap = styled.div``;

const AddTodoBtn = styled.button`
  margin-bottom: 10px;
  padding: 10px;
  background-color: #c1a179;
  border-radius: 5px;
  color: white;
`;

const NewTodoModalContainer = styled.div``;

const NewTodoInput = styled.input``;
